import React, { useState, useEffect } from 'react';
import { useNavigate, Link } from 'react-router-dom';
import axios from 'axios';

const racasOptions = [
  'Labrador',
  'Bulldog',
  'Poodle',
  'Golden Retriever',
  'Beagle',
  'Shih Tzu',
  'Boxer'
];
const corOptions = [
  'Marrom',
  'Preto',
  'Branco',
  'Caramelo',
  'Cinza',
  'Preto e Branco'
];
const porteOptions = ['pequeno','medio','grande'];
const sexoOptions  = ['macho','femea'];

export default function NovoPet() {
  const navigate = useNavigate();
  const [form, setForm] = useState({
    nome: '',
    especie: 'Cachorro',
    raca: '',
    idade: '',
    peso: '',
    porte: 'pequeno',
    sexo: 'macho',
    cor: '',
    castrado: false,
    carteiraVacinacao: false,
    tutor: '',
    dono: '',
    criador: '',
    observacoes: ''
  });
  const [tutores, setTutores] = useState([]);
  const [donos, setDonos] = useState([]);
  const [admins, setAdmins] = useState([]);
  const [errors, setErrors] = useState({});

  useEffect(() => {
    axios.get('/api/tutores').then(r => setTutores(r.data));
    axios.get('/api/donos').then(r => setDonos(r.data));
    axios.get('/api/admin').then(r => setAdmins(r.data));
  }, []);

  const handleChange = e => {
    const { name, value, type, checked } = e.target;
    setForm(f => ({
      ...f,
      [name]: type === 'checkbox' ? checked : value
    }));
    setErrors(errs => ({ ...errs, [name]: null }));
  };

  const handleSubmit = async e => {
    e.preventDefault();
    try {
      await axios.post('/api/pets', {
        ...form,
        idade: Number(form.idade),
        peso: Number(form.peso)
      });
      navigate('/pets');
    } catch (err) {
      const resp = err.response?.data;
      if (resp?.erros) {
        const fieldErrors = resp.erros.reduce(
          (acc, cur) => ({ ...acc, [cur.param]: cur.msg }),
          {}
        );
        setErrors(fieldErrors);
      } else {
        setErrors({ form: resp?.erro || 'Erro ao cadastrar pet' });
      }
    }
  };

  return (
    <div className="container my-5">
      <h2>Cadastrar Novo Pet</h2>
      <Link to="/pets" className="btn btn-link mb-3">← Voltar à Lista</Link>
      {errors.form && <div className="alert alert-danger">{errors.form}</div>}

      <form onSubmit={handleSubmit}>
        {/* ... demais campos iguais ... */}

        {/* Cor */}
        <div className="mb-3">
          <label className="form-label">Cor</label>
          <select
            name="cor"
            className="form-select"
            value={form.cor}
            onChange={handleChange}
            required
          >
            <option value="">— selecione —</option>
            {corOptions.map(c => (
              <option key={c} value={c}>{c}</option>
            ))}
          </select>
          {errors.cor && <div className="text-danger">{errors.cor}</div>}
        </div>

        {/* Castrado */}
        <div className="form-check mb-3">
          <input
            type="checkbox"
            name="castrado"
            id="castrado"
            className="form-check-input"
            checked={form.castrado}
            onChange={handleChange}
          />
          <label htmlFor="castrado" className="form-check-label">Castrado</label>
        </div>

        {/* Carteira de Vacinação */}
        <div className="form-check mb-3">
          <input
            type="checkbox"
            name="carteiraVacinacao"
            id="vacina"
            className="form-check-input"
            checked={form.carteiraVacinacao}
            onChange={handleChange}
            required
          />
          <label htmlFor="vacina" className="form-check-label">
            Carteira de Vacinação em Dia *
          </label>
          {errors.carteiraVacinacao && (
            <div className="text-danger">{errors.carteiraVacinacao}</div>
          )}
        </div>

        {/* … restante do formulário … */}
        <button type="submit" className="btn btn-primary">
          Cadastrar Pet
        </button>
      </form>
    </div>
  );
}
